from itertools import count, islice
from sympy import divisors, divisor_count as tau
def f(k): return sum(1 for d in divisors(k, generator=True) if tau(d*k) == tau(k//d + d))
def agen(): # generator of terms
    adict, n = dict(), 0
    for k in count(1):
        v = f(k)
        if v not in adict:
            adict[v] = k
            while n in adict: yield adict[n]; n += 1
print(list(islice(agen(), 7))) # _Michael S. Branicky_, Jan 16 2026

